class Product{constructor(t){this.Name=t.Name,this.Vegan=1===t.Is_Vegan,this.Image=t.Image,this.Brand=new Brand(t)}static search(t){return new Promise(e=>Ajax.Post("search",{body:{query:t},success:{ok:t=>e(t.body.map(t=>new Product(t)))}}))}static reportMissing(){Dialog.ShowCustom(Localizer.MISSING_PRODUCT_TITLE,Localizer.MISSING_PRODUCT_DESC,'\n\t\t\t\t<chip-form>\n\t\t\t\t\t<chip-input\n\t\t\t\t\t\tid="txtProductName"\n\t\t\t\t\t\trequired\n\t\t\t\t\t\tmax-length="100"\n\t\t\t\t\t\tlabel="Product">\n\t\t\t\t\t</chip-input>\n\n\t\t\t\t\t<chip-input\n\t\t\t\t\t\tid="txtProductBrand"\n\t\t\t\t\t\trequired\n\t\t\t\t\t\tclass="mt-form"\n\t\t\t\t\t\tmax-length="100"\n\t\t\t\t\t\tlabel="Brand/Company">\n\t\t\t\t\t</chip-input>\n\t\t\t\t</chip-form>\n\t\t\t',{Size:"md",OnCheckValid:t=>t.querySelector("chip-form").reportValidity(),AffirmativeText:"Submit"}).then(()=>report(drpType.value,"User Submitted Feedback",`A user has reporting a product as missing:\n**Name**: ${txtProductName.value.trim()}\n**Brand**: ${txtProductBrand.value.trim()}`))}reportIncorrect(){Dialog.ShowTextBox(Localizer.INCORRECT_INFORMATION_TITLE,Localizer.INCORRECT_INFORMATION_DESC,{Rows:12,Multiline:!0}).then(t=>{report("INCORRECT-INFO","Incorrect Product Information",`Using the built in feedback feature, a user has reported that **${this.Name}** by **${this.Brand.Name}** has incorrect information, stating:\n>${t}`)})}}